script: |
  super -f text -I q248.spq | sort > q248.out

inputs:
  - name: q248.spq
    data: |
      SELECT - ( col2 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE + 66 * - 51 NOT BETWEEN + ( + 95 ) AND NULL;
  - name: tab1

outputs:
  - name: q248.out
    data: |
      -59
      -68
      -96
